import React, { Component } from "react";
import Input from "../../common/Input";
import { Avatar } from "@mui/material";
import "../../css/inpu.css"

class Counselor_Signup extends Component {
 
  state = {
    account: {
      email: "",
      password: "",
      firstname: "",
      lastname: "",
      phoneno: "",
      gender:"",
      education:"",
      experience:""
    },
    step:1
  };

  
  handletype = (e) => {
    const account = { ...this.state.account };
    if(e.currentTarget.name==="gender"){
      account["gender"]= e.currentTarget.value   
    }else{
      account[e.currentTarget.name] = e.currentTarget.value;
    }
    
    this.setState({ account });
    
   
  };
  handlesubmit = (e) => {
    console.log(this.state)
    e.preventDefault();
  };
  fun1 =()=> {
    this.setState({...this.state,step:0})
    const firstName = this.state.account.firstname;
    //console.log('First Name:', firstName);
  }
  
  render() {
    
 
    return (
      <React.Fragment>
        {this.state.step?
        
        <div className="fluid-container pt-4 signup_container ">
        <div
          className="shadow ps-1 m-5 bg-white signupform_radius"
          style={{height:"39vw"}}
        >
          <div className="row">
            <div className="col-sm-5 signupform_leftside" >
              <Avatar
                className="m-5"
                sx={{ width: 250, height: 250 }}
                src="images/signup.png"
              />

              <h1 className="mt-3">Let's Get You Set Up </h1>
              <p className="mt-2">
                It should take only a couple of minutes to pair with your
                watch
              </p>
            </div>

            <div id="form-col" className="col-sm-7 signupform_rightside">
              
            <form id="form" onSubmit={this.handlesubmit}>
                
            <Input
            label="First Name"
          
                  value={this.state.account.firstname}
                  name="firstname"
                  type="text"
                  onchange={this.handletype}
                  placeholder="First Name"
                />

                <Input
                label="Last Name"
  
                  value={this.state.account.lastname}
                  name="lastname"
                  type="text"
                  onchange={this.handletype}
                  placeholder="Last Name"
                />

                <Input
                label="Phone Number"

                  value={this.state.account.phoneno}
                  name="phoneno"
                  type="tel"
                  onchange={this.handletype}
                  placeholder="Phone Number"
                />

                <Input
                label="Email"
                  
                  value={this.state.account.email}
                  name="email"
                  type="email"
                  onchange={this.handletype}
                  placeholder="Email"
                />

                <Input
                label="Password"
      
                  value={this.state.account.password}
                  name="password"
                  type="password"
                  onchange={this.handletype}
                  placeholder="Password"
                />
              
                  
      <input
       label="Male"
        type="radio"
        value={1}
        name="gender"
        onChange={(e)=>this.handletype(e)}
      />
     
    
    
      <input
        label="Female"
        type="radio"
        value={0}
        name="gender"
        onChange={this.handletype}
        className="signup_radio"
      />
    
  
                
    <div className="signup_button">
          <button type="submit" className="btn btn-primary inputbtn mt-3" onClick={this.fun1}>
                  Back
                </button>
                <button type="submit" className="btn btn-primary  inputbtn mt-3" onClick={this.fun1}>
                  Next
                </button>
                
                </div>
              </form>
            </div>
          </div>
        </div>
      </div>


        :
        <div className="fluid-container pt-4 signup_container ">
        <div
          className="shadow ps-1 m-5 bg-white signupform_radius"
          style={{height:"39vw"}}
        >
          <div className="row">
            <div className="col-sm-5 signupform_leftside" >
              <Avatar
                className="m-5"
                sx={{ width: 250, height: 250 }}
                src="images/signup.png"
              />

              <h1 className="mt-3">Let's Get You Set Up </h1>
              <p className="mt-2">
                It should take only a couple of minutes to pair with your
                watch
              </p>
            </div>

      <div id="form-col" className="col-sm-7 signupform_rightside">
              <form id="form" onSubmit={this.handlesubmit}>
                  
              <Input
              label="Experience"
                    
                    value={this.state.account.experience}
                    name="experience"
                    type="text"
                    onchange={this.handletype}
                    placeholder="Experience"
                  />

                  <Input
                  label="Education"
                    
                    value={this.state.account.education}
                    name="education"
                    type="text"
                    onchange={this.handletype}
                    placeholder="Education"
                  />

                  
                   
                  

<div className="signup_button">
          <button type="submit" className="btn btn-primary inputbtn mt-3" onClick={this.fun1}>
                  Back
                </button>
                <button type="submit" className="btn btn-primary  inputbtn mt-3" onClick={this.fun1}>
                  Submit
                </button>
                
                </div>
                </form>
              </div>
            </div>
          </div>
        </div>
        
        
        
        }
        
        </React.Fragment>
    );
  }
}

export default Counselor_Signup;
